import React from 'react';
import ReactDOM from 'react-dom';

class Aplikasi extends React.Component {
    render() {
        return (
            <div>
                Aplikasi Ke {this.props.ke}
                <Pokemon/>
            </div>
        );
    }
}

class Pokemon extends React.Component {
    render() {
        return <img width="80" src="https://toppng.com/public/uploads/preview/8bit-pikachu-pikachu-8-bit-11562925266scbos6ma3e.png"/>
    }
}

ReactDOM.render(<Aplikasi ke="20" />, document.getElementById('app'));




























